import React, { Component } from 'react';
import './Query.css';

class Query extends Component {
    state = {
        keyword: ''
    }

    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="query-contatiner">
                Query Page {this.props.location.state.query} {this.props.location.state.isQuery}
            </div>
        )
    }
}

export default Query;
